import Header from './Header';
import {Container } from '@material-ui/core';
import Head from 'next/head';


const Layout = props => (
  <Container >
      <Head>
        <title>Dashboard</title>
        <link rel="shortcut icon" href="/static/favicon.ico" />
      </Head>
      <Header />
      {props.children}
  </Container>
);

export default Layout;
